@Xindi Xu - Just uncomment these `root_dir` and `reader_config` here (https://github.com/instabase/instabase/blob/8d5f21545ee3f955d1641a562de21fedc48e0622/shared-utils/py-utils/ibllm/examples/benchmarking/res/benchmark_classification_cfg.yml#L5-L25) and run
```/Users/sunnykhatri/miniconda3/envs/py39_17/bin/python $IB_HOME/shared-utils/py-utils/ibllm/examples/benchmarking/benchmark.py test_classify classification```
This will kickoff a simple benchmark run making use of ibllm and model service code. It doesn't hit any running service, just executes the code. I think what's happening is something is causing logging `basicConfig` to be called with a `WARNING` somewhere and hence any subsequent level set `INFO` is failing unless we set these level explicitly on the logger.
